import React, { useState } from 'react';
import LogBookList from '../logbook/LogBookList';

const PegawaiList = ({ onRegister }) => {
  // Placeholder: nanti diisi fetch user dari API
  const users = [
    { id: 1, nama_lengkap: 'Budi', role: 'officer', pos: 'Terminal Protection' },
    { id: 2, nama_lengkap: 'Siti', role: 'supervisor', pos: 'Screening' },
  ];
  return (
    <div>
      <h2>Daftar Pegawai</h2>
      <button onClick={onRegister}>Register User</button>
      <ul>
        {users.filter(u => u.role === 'officer' || u.role === 'supervisor').map(user => (
          <li key={user.id}>{user.nama_lengkap} - {user.role} - {user.pos}</li>
        ))}
      </ul>
    </div>
  );
};

const RegisterUserForm = ({ onBack }) => {
  // Placeholder: form register user
  return (
    <div>
      <h2>Register User</h2>
      <form>
        {/* Tambahkan input sesuai kebutuhan */}
        <input placeholder="Nama Lengkap" />
        <input placeholder="Email" />
        <input placeholder="Password" type="password" />
        <select>
          <option value="officer">Officer</option>
          <option value="supervisor">Supervisor</option>
        </select>
        <input placeholder="Pos" />
        <button type="submit">Register</button>
        <button type="button" onClick={onBack}>Kembali</button>
      </form>
    </div>
  );
};

const SuperAdminDashboard = () => {
  const [page, setPage] = useState('main');

  if (page === 'logbook') return <div><button onClick={() => setPage('main')}>Kembali</button><LogBookList /></div>;
  if (page === 'pegawai') return <div><button onClick={() => setPage('main')}>Kembali</button><PegawaiList onRegister={() => setPage('register')} /></div>;
  if (page === 'register') return <RegisterUserForm onBack={() => setPage('pegawai')} />;

  return (
    <div style={{ display: 'flex', gap: 32 }}>
      <div style={{ border: '1px solid #ccc', padding: 32, cursor: 'pointer' }} onClick={() => setPage('logbook')}>
        <h2>Log Book</h2>
        <p>Lihat semua log book/laporan</p>
      </div>
      <div style={{ border: '1px solid #ccc', padding: 32, cursor: 'pointer' }} onClick={() => setPage('pegawai')}>
        <h2>Pegawai</h2>
        <p>Lihat dan kelola data pegawai</p>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
